import React,{Component} from 'react';
import styles from '../Mcss.module.css';
class HomePage extends Component{
    render(){
        return <div>
                    <h1>Home page</h1>
                    <h2 className={styles.textStyle}>My Name Ismail Saheb</h2>
               </div>
    }
}
export default HomePage;
